import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import UserProvider from './context/UserProvider'

import {BrowserRouter as R} from 'react-router-dom'


ReactDOM.render(

    <BrowserRouter>
    <UserProvider>

    <App />

    </UserProvider>
    </BrowserRouter>,

  document.getElementById('root')
);
